import React from 'react';
import './App.css';
import Main from './components/Main.js';
import Login from './components/Login';

function App() {

	const isLoggedIn = true;

	return (
		<div className="App">
			{isLoggedIn && <Login/>}
			{!isLoggedIn && <Main />}
		</div>
	);
}

export default App;
